import './App.css';
import React from 'react';
import Header from './Header';
import Content from './Content';
import Footer from './Footer';

// eslint-disable-next-line no-undef
class App extends React.Component {
  render() {
    return (
      <div>
      <Header />
      <Content />
      <Footer />
      </div>
    )    
  }
}

export default App;
